import React, { useState, useEffect } from 'react';
import './App.css';
import { Console } from 'console';

type ObjectType = {
    id: string;
    name: string,
    description: string,
    colorIdentifier: string,
    // zde pridat dalsi props
}

// type ColorIdentType = {
//     ident: string,
//     props: 
// }


export default function App() {

    const [objectsArray, setObjectsArray] = useState<ObjectType[]>([]); 

    const colorIdents = [{
        ident: 'un',
        props: {
            color: 'red'
        }
    }, {
        ident: 'deux',
        props: {
            color: 'green'
        }
    }, {
        ident: 'trois',
        props: {
            color: 'blue'
        }
    }]

    const getRandomNumber = (): number => {
        const randomDecimal = Math.random();

        // Scale the random decimal to the range [0, 1, 2, 3]
        const randomNumber = Math.floor(randomDecimal * 4); // 4 because we want numbers from 0 to 3

        return randomNumber;
      };

    useEffect(() => {

        const makeUniqueId = (base: String, i: String) => `${base}-${i}`;

        // vyresit colors: any - zkusit nadefinovat vlastni typ
        const randomColorIdentifier = (colors: any) => {
            colors.map((color: any) => {
                let ident = color.ident;
                console.log("ident: " + ident);
            })
        }

        const newArray: ObjectType[] = [];
        const numberOfObjects = 5;
        const randomNumber = getRandomNumber();

        for (let i = 1; i <= numberOfObjects; i++) {
            newArray.push({
                id: makeUniqueId('random', i.toString()),
                name: '',
                description: '',
                colorIdentifier: ''
            });
        }

        setObjectsArray([...newArray]);
        randomColorIdentifier(colorIdents);

    }, []); //na konci prazdne pole, projde tedy pouze jednou pri page load



    console.log(objectsArray);
    console.log(randomNumber);

    return (
        <div>
        <h2>Generated Objects:</h2>
        <ul>
          {objectsArray.map((object) => (
            <li key={object.id}>{object.id}</li>
          ))}
        </ul>
      </div>
    )
}
